CREATE TABLE `bookorder` (
  `orderId` int(11) NOT NULL AUTO_INCREMENT,
  `bookId` int(11) DEFAULT NULL,
  `sellerid` int(11) DEFAULT NULL,
  `buyerid` int(11) DEFAULT NULL,
  `orderTime` datetime DEFAULT NULL,
  `orderType` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`orderId`),
  KEY `FKEF3FE5C548FB0873` (`bookId`),
  KEY `FKEF3FE5C5AA1AF59F` (`buyerid`),
  KEY `FKEF3FE5C5E2E2006B` (`sellerid`),
  CONSTRAINT `FKEF3FE5C548FB0873` FOREIGN KEY (`bookId`) REFERENCES `book` (`bookId`),
  CONSTRAINT `FKEF3FE5C5AA1AF59F` FOREIGN KEY (`buyerid`) REFERENCES `user` (`userId`),
  CONSTRAINT `FKEF3FE5C5E2E2006B` FOREIGN KEY (`sellerid`) REFERENCES `user` (`userId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

